import React from "react";
import Skill from "./Skill";

const SkillList = ({ skills }) => {
    return(
        <div>
            {skills.map((skill, index) => (
                <Skill key={index} image={skill.image} alt={skill.name} />
            ))}
        </div>
    );
}

export default SkillList;
